import PropTypes from 'prop-types';
import React from 'react';

export default function MomoLogo({ width = 100, height = 30 }) {
  return (
    <img
      width={width}
      height={height}
      src="data:image/png;base64,"
      alt="Momo"
      role="presentation"
    />
  );
}

MomoLogo.propTypes = {
  height: PropTypes.number,
  width: PropTypes.number
};

MomoLogo.defaultProps = {
  height: 30,
  width: 100
};
